import React from "react";
import "../../stylesheets/main.css";

const AboutMeLink = () => {
  return (
    <div id="about-me-wrapper" className="link-box">
            <Link to="/contact-me">
      <div>
        <p>Continue Learning?</p>
        <span>About Me</span>
      </div>\</Link>
    </div>
  );
};

export default AboutMeLink;
